import React from "react";
import styled from "styled-components";

const SignUp = () => {
    return(
        <Center>
            <Wrapper>
                <div>회원가입</div>
                <div>
                    <div>이름</div>
                    <input />
                </div>
                <div>
                    <div>아이디</div>
                    <input />
                </div>
                <div>
                    <div>비밀번호</div>
                    <input />
                </div>
                <div>
                    <div>비밀번호 확인</div>
                    <input />
                </div>
                <button>완료</button>
            </Wrapper>
        </Center>
    )
}

export default SignUp



const Center = styled.div`
    display: flex;
    justify-content: center;
    margin-top: 100px;
`

const Wrapper = styled.div`
    display: flex;
    flex-direction: column;
    align-items: center;
    border: 1px solid black;
    width: 450px;
    height: 550px;
`
